import React, { Component } from "react";
import Guest from "./guest";

export default class GuestList extends Component {
  render() {
    return (
      <div>
        {this.props.guests.map(guest => (
          <Guest key={guest.id} {...guest} />
        ))}
      </div>
    );
  }
}
